import logo from './assets/logo.png';
import './App.css';

export default function App() {
  const history = useHistory();
  const handleRegister = () => {
    history.push('/register');
  };
  const handleLogoClick = () => {
    history.push('/');
  };
  return (
    <div className='App container'>
      <Routes />
